import React, { Component } from "react";
import { AuthTopBar } from "../constants.js";

class AdminLogin extends Component {
	constructor() {
		super();
		this.state = {
			users: ""
		};
	}

	render() {
		return (
			<div className="valign-wrapper">
				<AuthTopBar />
			</div>
		);
	}
}

export default AdminLogin;
